export function getCategoriesFromDB() {
    let returnValue = {};

    fetch('http://127.0.0.1:8000/api/categories/')
        .then(res => res.json())
        .then((data) => {
            returnValue = data;
        })
        .catch(console.log);

    return returnValue;
}
